import React from 'react'

const GenreTable = () => {
  return (
    <div>
      <thead>
        <tr>
          <th scope="col">Title</th>
          <th scope="col">Genre</th>
          <th scope="col">Stock</th>
          <th scope="col">Rate</th>
          <th scope="col"> </th>
        </tr>
      </thead>
      ;
    </div>
  );
}

export default GenreTable
